import React from 'react';

import PictureButton from './../../components/PictureButton.js'
import IconButton from './../../components/IconButton.js'
import Carousel from './../../components/Carousel.js'

import './Spotify.css';

import s from './../../assets/spotify@4x.png';

function Spotify() {
    var image = <img class="image" src={s}></img>;

    return (
        <div class="spotify">
            <div class="top">
                <div class="imageContainer">
                  {image != null ? image : <img class="image" src={image}></img>}
                </div>
                <p class="big-text"> Analytics & Modeling My Listening Habits </p>
                <p class="text"> <i> A project built using Python, Jupyter Notebook, and the Spotify API. </i> <br /> Inspired by my data science + ML courses, fueled by my love for music. </p>
            </div>
            <div class="bottom">
                <p class="text"> Hello </p>
            </div>
        </div>
    );
}

export default Spotify;
